import React from "react";
import "./footer.css";

const Footer = () => {
  return (
    <footer className="footer">
      <div className="container">
        {/* About Section */}
        <p>
          <strong>Enactus FSBM</strong><br />
          Empowering students to change the world through entrepreneurial action.
        </p>

        {/* Contact Info */}
        <div className="contact-info">
          <p>
            <strong>Contact Us:</strong><br />
            Email: <a href="mailto:enactus24.25fsbm@gmail.com">enactus24.25fsbm@gmail.com</a><br />
            Phone: +212 639 380 894<br />
            Address: Faculté des Sciences Ben M'Sick - Bd Commandant Driss Al Harti, Casablanca 20670 - Maroc
          </p>
        </div>

        {/* Social Media Links */}
        <div className="social-links">
          <a href="https://www.linkedin.com/company/enactus-fsbmc/">
            <img src="linkedin.png"/>
          </a>
          <a href="https://www.linkedin.com/company/enactus-fsbmc/" aria-label="LinkedIn" target="_blank" rel="noopener noreferrer">LinkedIn</a>
          <a href="https://www.tiktok.com/@enactus.fsbmposting" aria-label="TikTok" target="_blank" rel="noopener noreferrer">TikTok</a>
          <a href="https://www.instagram.com/3nac1us.fsbm?igsh=YWcyaGQyOGMzNzJo" aria-label="Instagram" target="_blank" rel="noopener noreferrer">Instagram</a>
        </div>

        {/* Legal Section */}
        <p className="legal">
          © 2024 Enactus FSBM. All rights reserved.
        </p>
      </div>
    </footer>
  );
};

export default Footer;
